import React, { Fragment } from 'react'
import './NavBar.css'
import CartWidget from '../CartWidget/CartWidget'

const NavBar = () => {
//display:'flex',flexDirection: 'row'
    return(
        <React.Fragment>
            <div class="Navbar" style={{borderBottom: 'Solid 2px white', backgroundColor:'#282c34'}}>
                <ul style={{position: 'flex',listStyle: 'none'}}>
                  <p>Home</p>
                  <p>Producto</p>
                  <p>Ubicacion</p>
                  <p>Contacto</p>
                    <CartWidget />
                </ul>

            </div>   
         </React.Fragment>     

    )
}

export default NavBar;
